import React from 'react';
import './About.css';

function About() {
  return (
    <section id="about" className="about-section">
      <h2 className="section-title">About Me</h2>
      <div className="about-content">
        <p>
          I am currently in my final year of B.Tech pursuing a degree in Computer Science and Engineering with a specialization in AIML, focusing on developing my skills in Python and machine learning.
        </p>
        <p>
          I completed my schooling at ORBIT e-Techno School and my intermediate education at Shivani Junior College.
        </p>
        <p>
          In my free time, I enjoy playing cricket and chess.
        </p>
      </div>
    </section>
  );
}

export default About;
